import { Button, ListGroup } from "reactstrap";
import { Link } from "react-scroll";
import "bootstrap/dist/css/bootstrap.min.css";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faFacebookF, faGithub } from "@fortawesome/free-brands-svg-icons";
import {
  faCoffee,
  faHome,
  faContactCard,
  faChalkboard,
  faWindowMaximize,
  faList,
} from "@fortawesome/free-solid-svg-icons";
const Menu = () => {
  return (
    <div>
      <div className="sidenav text-xs ">
        <li className="active text-sm">
          <Link
            className="cursor-pointer nav-link text-blue-50"
            activeClass="active"
            to="intro"
            spy={true}
            smooth={true}
            offset={-60}
            duration={50}
            isDynamic={true}
          >
            <FontAwesomeIcon className="me-3" icon={faHome} />
            Home
          </Link>
        </li>

        <li className="nav-item">
          <Link
            className="cursor-pointer nav-link"
            activeClass="active"
            to="projects"
            spy={true}
            smooth={true}
            offset={-14}
            duration={50}
            // onSetActive={this.handleSetActive}
          >
            <FontAwesomeIcon className="me-3" icon={faChalkboard} />
            Projects
          </Link>
        </li>

        <li className="nav-item">
          <Link
            className="cursor-pointer nav-link"
            activeClass="active"
            to="skills"
            spy={true}
            smooth={true}
            offset={-40}
            duration={50}
            // onSetActive={this.handleSetActive}
          >
            <FontAwesomeIcon className="me-3" icon={faWindowMaximize} />
            Skills
          </Link>
        </li>

        <li className="nav-item">
          <Link
            className="cursor-pointer nav-link"
            activeClass="active"
            to="exp"
            spy={true}
            smooth={true}
            offset={-40}
            duration={50}
            // onSetActive={this.handleSetActive}
          >
            <FontAwesomeIcon className="me-3" icon={faList} />
            Experience
          </Link>
        </li>

        <li className="nav-item">
          <Link
            className="cursor-pointer nav-link"
            activeClass="active"
            to="contact"
            spy={true}
            smooth={true}
            offset={-40}
            duration={50}
            // onSetActive={this.handleSetActive}
          >
            <FontAwesomeIcon className="me-3" icon={faContactCard} />
            Contact
          </Link>
        </li>
        <li></li>
        <span class>
          <FontAwesomeIcon
            className="me-3 w-10"
            icon={faGithub}
            color="white"
            size="2x"
          />
        </span>
      </div>
    </div>
  );
};
export default Menu;
